import React, {Component} from 'react';

class Message extends Component {
    constructor() {
        super()
        this.state = {
            message: 'Welcome visitor'
        }
    }
    buttonClick = () => {
        this.setState(
            {
                message:'thankx bru'
            })
    }

    render() {
        return (
            <div>
                <h1>{this.state.message}</h1>
                <button onClick={this.buttonClick()}>Subscribe</button>
            </div>
        );
    }
}

export default Message;
